import React from "react";

export const Movies = () => {
  const [movies, setMovies] = useState([]);

  return (
    <>
      <ul>
        {movies &&
          movies.map((movie) => {
            return (
              <li key={movie.imdbID}>
                <h1>{movie.Title}</h1>
                <img src={movie && movie.Poster} />
                <h3>{movie.Year}</h3>
              </li>
            );
          })}
      </ul>
    </>
  );
};
